import React, { useEffect, useState } from "react";
import { GoogleApiWrapper, Map, Marker } from "google-maps-react";

export class MapContainer extends React.Component {
  state = { center: { lat: 37.85, lng: -122.541 }, markers: null };

  fetchPlaces = (mapProps, map) => {
    let coordinates = [];
    const { google } = mapProps;
    const service = new google.maps.places.PlacesService(map);
    var request = {
      location: this.state.center,
      radius: "500",
      query: "restaurant"
    };
    service.textSearch(request, (results, status) => {
      if (status == google.maps.places.PlacesServiceStatus.OK) {
        for (var i = 0; i < results.length; i++) {
          //console.log(results[i]);
          coordinates.push(results[i]);
        }
        this.setState({ markers: coordinates });
      }
    });
  };

  clickMarker = (props, marker) => {
    console.log(props.placeId);
  };

  componentDidMount(props) {
    var myHeaders = new Headers();
    // myHeaders.append("Authorization", "Bearer --Token Here--");
    myHeaders.append("Authorization", "Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..sPzZm5h_EOfChJYQunrKftez7eEXAJ54ssmZqKh6Xyc");

    var requestOptions = {
        method: 'GET',
        headers: myHeaders,
        body: undefined,
        redirect: 'follow'
    };

    fetch("https://api.iq.inrix.com/lots/v3?point=37.74638779388551%7C-122.42209196090698&radius=1000", requestOptions)
    .then(response => response.text())
    .then(result => console.log(result))
    .catch(error => console.log('error', error));
    }

    render() {
        const { userLocation } = this.state;
        const { google } = this.props;

    return <Map
            google={google} 
            center={{
                lat: 37.85,
                lng: -122.541
            }} 
            onReady = {this.fetchPlaces}
            style={{ height: "100%", position: "relative", width: "100%" }}
            zoom={8}>
                {this.state.markers != null &&
                this.state.markers.map(coords => (
                <Marker
                    key={coords.place_id}
                    position={coords.geometry.location}
                    onClick={this.clickMarker}
                    placeId={coords.place_id}
                />
                ))}
            </Map>;
  }
}

export default GoogleApiWrapper({
  apiKey: "AIzaSyDrcb7m1SF9y8PMHuiC1JzRg2emyaRZJTg"
})(MapContainer);
